import React from "react";
import NewsDetails from "./NewsDetails";



const IndividualNews = (props) => {
  return (
    <>
      <div className="container shadow mt-5 p-5 ">{props.title}</div>
      <NewsDetails />
    </>
  );
};

export default IndividualNews;
